import Typed from 'react-typed';
export default function HeroSection(){
  
    return (
      
        //<iframe src="C:/Users/dell/OneDrive/Desktop/my-files/nedamco projects/Portfolio/index.html" title="Portfolio" />
        <section id="heroSection" className="hero--section">
          <div className="hero--section--content--box">
            <div className="hero--section--content">
              <p className="section--title">Hey, I'm Tihetna Mesfin </p>
              <h3>And I'm a <span class="multiple-text">
              <Typed
        strings={['Frontend Developer', 'Lecturer', 'Researcher']}
        typeSpeed={100}
        backSpeed={100}
        backDelay={1000}
        loop
      />
                </span></h3>
              <h1>
                <span className="hero--section-title--color">
                    FullStack 
                </span>{" "}
                <br />
                Developer

              </h1>
              <p className="hero--section-description">This my offficial portfolio website to show all
                <br />Details and work experience.
              </p>
              
            </div>
            <button className="btn btn-primary btn-outline-primary">Get In Touch</button>
          </div>
          <div className="hero--section--img">
            <img src="./img/titi3.png" alt="Hero Section" />
          </div>
          
       
        </section>
       
        
      );
      
      
      
        
}
